
def maps(a):
    # Remove duplicate from a and multiply each element by 2. The order should remain the same.
    b = []
    for i in a:
        if i not in b:
            b.append(i)
    return [i*2 for i in b]
                
def maps1(a):
    b=[]
    for i in a:
        if i not in b:
            b.append(i)
    for j,k in enumerate(b):
        b[j]=k*2
    return b

